	innerHtml:	"<div name=\"dCon\" style=\"position: absolute; left: 0px; top: 0px; width: 405px; min-height: 321px;\"><div name=\"dCon2\" class=\"ttxt\" style=\"left: 5px; top: 5px; width: 395px; min-height: 311px;\"><p style=\"line-height: 1.5; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt; color: rgb(51, 51, 51); font-family: Arial, sans-serif;\">Antall mennesker på jorda som lever med kronisk sult har sunket, men fortsatt lever ca. 13% av verdens befolkning uten nok mat. </span></p>\n\n<p style=\"line-height: 1.5; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt; color: rgb(51, 51, 51); font-family: Arial, sans-serif;\">Vi må gjøre endringer for å få en mer rettferdig fordeling av maten, slik at alle kan spise seg mette. Samtidig må vi ta hensyn til at vi stadig blir flere mennesker på jorda. </span></p>\n\n<p style=\"line-height: 1.5; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt;\">​</span></p>\n\n<p style=\"line-height: 1.5; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt; color: rgb(51, 51, 51); font-family: Arial, sans-serif;\">Mat må vi ha, men hva vi velger å spise, hvordan vi produserer maten og hvor mye av den som havner i søpla, gjør en stor forskjell.</span></p></div></div>",
